const data = {
	datasets: [
      {
        hoverBorderColor: "#ffffff",
        data: [68.3, 24.2, 7.5],
        backgroundColor: [
          "rgba(0,255,123,0.9)",
          "rgba(0,255,123,0.5)",
          "rgba(0,255,123,0.3)"
        ]
      }
    ],
	labels: ["Steak", "Chicken", "Apple"]
};

export default data;
